import ReactDOM from 'react-dom';
import React, { Component } from 'react';
import '../Css/Componentscss.css';
import '../Css/signinpagecss.css';

import { useState, useEffect, history } from 'react';
import { Link, Route, Switch, withRouter } from 'react-router-dom';
import Navbar from '../Navbar/Navbar.js';

import { useDispatch, useSelector } from 'react-redux';









function Signin(props) {

    const dispatch = useDispatch();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    
    const submitHandler = (e) => {
        e.preventDefault();

    }

    useEffect(() => {
       
    })



    return (
        <div className='Frontpage grid-container'>
            <Navbar />

            <main className='main'>
                <div className='form'>
                    
                    <form onSubmit={submitHandler}>

                        <ul className='form-container'>
                            <h3> Signin </h3>
                            <li>
                                <label for='email'> Email </label>
                                <input type='email' name='email' id='email' onChange={(event) => { setEmail(event.target.value) }}/> 
                            </li>

                            <li>
                                <label for='password'> Password </label>
                                <input type='password' name='password' id='password' onChange={(event) => { setPassword(event.target.value) }}/> 
                            </li>

                            <li>
                                <button className='button primary' type='submit'> signin </button>
                            </li>

                            <li>
                                New to Fosy Store?
                            </li>
                            <li>
                                <Link to="/register" className='button secondary'> Create your Fosy Store account </Link>
                            </li>

                        </ul>


                    </form>



                </div>






            </main>



            <footer className='footer'>
                All rights reserved || Developed by Foster Ogwudu
                </footer>

        </div>
    )
}




export default Signin;
